import React, { useState } from 'react';

function Form() {
  const [name, setName] = useState('');

  return (
    <form>
        <input
          type="text"
          id='name'
          value={name}
          onChange={({ target }) => setName(target.name)}
        />
    </form>
  );
}

export default Form;
